post.description:
list of endotypes based on input
@input
- JSON object with required input

@return
- JSON object that returns array of predicted endotypes

Query the BioLink-compliant knowledge graph using the [Reasoner API query specifications](https://github.com/NCATS-Tangerine/NCATS-ReasonerStdAPI/tree/master/API#top-level-message-class).

Use this example query for COHD:
```json 
{
  "max_results": 50,
  "message": {
    "query_graph": {
      "nodes": [
        { "id": "n00", "type": "Procedure" },
        { "id": "n01", "type": "Drug" }
      ],
      "edges": [
        { "id": "e00", "type": "Association",
          "source_id": "n00", "target_id": "n01" }
      ]
    },
    "query_options": {
	   "https://w3id.org/trek/cohd/attribute/ttest_results": "1.5e+02",
	   "https://w3id.org/trek/cohd/attribute/ttest_pvalue": "1.338936e-87"
    }
  }
}
```

